import BioData from "./components/BioData";
import persons from "./data";

function App() {
  return (
    <div className="bg-slate-800 min-h-screen text-white flex flex-col my-3">
      {persons.map((person, index) => (
        <BioData person={person} key={index} />
      ))}
    </div>
  );
}

export default App;
